import React from 'react';
import ReactDOM from 'react-dom';

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
function App() {
  return <main>
    <ItalicText color='yellow'>Hello</ItalicText> World
  </main>;
}
function ItalicText(props) {
  return <i style={{color: props.color}}>
    {props.children}
  </i>;
}
